import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Login from './pages/Login';
import Register from './pages/Register';
import Home from './pages/Home';
import General from './pages/General/General';
import UserProfile from './pages/UserProfile/UserProfile'; // Add the UserProfile page component
import { AuthProvider } from './context/AuthContext'; // Ensure the correct path
import Team  from  './pages/Team/Team';
import QuantitativeTrading from './pages/Quantity/Quantity';
import ViewTeamList from '.pages/ViewTeamList/ViewTeamList';

function App() {
  return (
    <AuthProvider>
      <Router>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />
          <Route path="/profile" element={<UserProfile />} /> {/* User profile page */}
          <Route path="/myteam" element={<Team />} /> {/* User team page */}
          <Route path="/quantity" element={<QuantitativeTrading/>}/>
          <Route path="/home" element={<General />} />
          <Route path="/team-list" element={<General />} />
        </Routes>
      </Router>
    </AuthProvider>
  );
}

export default App;
